import React from 'react';


function Playlist({ playlist }) {
  return (
    <div>
      <img src={playlist.albumUrl} style={{ height: '60px', width: '60px' }}></img>
      <p>{playlist.name}</p>
      <p>{playlist.description}</p>
    </div>
  )
}

export default Playlist;
